import React from "react";
import Modal from "./Modal";
import "./DeleteModal.css";

const DeleteModal = (props) => {
  return (
    <Modal onClose={props.onClose}>
      <div className="delete-modal-head"></div>
      <div>
        <div></div>
      </div>
    </Modal>
  );
};

export default DeleteModal;
